package com.ibm.in.sagaverm.gremlin;

public class FromGremlin {
	String label;
	String alias;
	
	public FromGremlin(String label, String alias) {
		super();
		this.label = label;
		this.alias = alias;
	}
	public FromGremlin() {
		// TODO Auto-generated constructor stub
	}
	public String getLabel() {
		return label;
	}
	public void setLabel(String label) {
		this.label = label;
	}
	public String getAlias() {
		return alias;
	}
	public void setAlias(String alias) {
		this.alias = alias;
	}
	
	
}	
